import { StyleSheet, Text, View } from "react-native";
import { NavigationContainer } from "@react-navigation/native";
import { createNativeStackNavigator } from "@react-navigation/native-stack";
import { collection, getDocs } from "firebase/firestore";
import { useEffect, useState } from "react";

const Stack = createNativeStackNavigator();

import Login from "./Components/Login";
import Lista from "./Components/Lista";
import Home from "./Components/Home";
import CadastrarLogin from "./Components/CadastrarLogin";
import firebase from './Components/Config/index';

export default function App() {
  const [dados, setDados] = useState("");

  useEffect(() => {
    const querySnapshot = getDocs(firebase.firestore().collection(db, "teste"));
    querySnapshot.forEach((doc) => {
      console.log(doc.id, " => ", doc.data());
    });
  }, []);

  return (
    <NavigationContainer style={styles.container}>
      <Stack.Navigator initialRouteName="Login">
        <Stack.Screen name="Login" component={Login} />
        <Stack.Screen name="Home" component={Home} />
        <Stack.Screen name="Lista" component={Lista} />
        <Stack.Screen name="Cadastrar login" component={CadastrarLogin} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
